import './Button.scss';

export const CtButton = ({ data }) => {
    return (
        <div className="ct__button prefixIcon">
            <div className='left'>
                {data.prefixIcon}
                {data.description}
            </div>
            <div className="right">
                {data.suffixIcon}
            </div>
        </div>
    );
}
